# EXPLICACION DEL PROGRAMA: Este programa consiste en una memoria cache, la cual tiene como caracteristicas
# Una memoria principal de 4GB, el tamano de la cache es de 512KB asociativa 4 vias, el tamano de bloque es de 64B
# y la politica de remplazo es LRU.
# En el arreglo accesses van las palabras que se desean analizar en la cache, este arreglo que se tiene es el ingresado
# por el profesor, pero se puede agregar cualquier otro.
#
# Se utilizaron muchas funciones para segmentar el codigo de manera mas ordenada, cada funcion tiene documentado
# que hace, los parametros que recibe y los parametros que retorna.
#
# Explicacion general: El programa primero se encarga de llenar los arreglos de Sets y tags de caracteres que indiquen que la cache
# esta vacia, por lo que se utiliza la funcion inicializarCacheEnCero, ahora se procede a ingresar y verificar cada dato del accesses
# para ver si es un hit o un miss, para esto se analiza palabra por palabra con la funcion getTagAndIndex, la cual regresa el tag y el
# index de la palabra que se le ingrese. El index se utiliza para acceder a los arreglos Sets y Tags, para el de tags se debe multiplicar
# el index por 16 y a esto sumarle 0, 4 , 8 o 12 dependiendo de cual via se quiera acceder, en el primer byte se guarda el bit de valido
# el cual es 0 hasta que se ingrese a esa posicion en la cache, y el dirty bit que no se utiliza para nada (asi dijo el profe). 
# Seguidamente en los restantes 2 bytes se guarda el tag, este tag se utiliza para comparar y saber si hubo un hit o miss.
# En caso de que se presente hit o miss se debe cambiar el arreglo de Sets, ya que es el que controla la logica LRU, si hay un hit
# El arreglo utiliza una funcion para controlar la logica LRU y poner la via que tuvo el hit como la mas recientemente usada, y colocar
# en las posiciones correspondientes las demas.
# En caso de que se presente un miss una funcion es llamada, la cual por medio de la logica LRU decide cual via debe ser remplazada, y 
# este dato se pasa al arreglo de tags para guardar el tag en la via correspondiente
# Al final el programa imprime el miss rate
