    #   Funcion que recibe en a0 la palabra a calcular el tag
    #   retorna en v0 el index (11 bits) y en v1 el tag (15 bits)

    getTagAndIndex:
        addi $sp, $sp, -8       # Pidiendo espacio en la pila
        sw $ra, 0($sp)          # Guardando en pila dato a utilizar
        sw $t0, 4($sp)          # Guardando en pila dato a utilizar

        move $t0, $a0           # Cargando la palabra en t0
        srl $t0, $t0, 6         # Desplazando 6 bits a la derecha para eliminar el offset
        andi $v0, $t0, 0x07FF   # Cargando en v0 el index   
        srl $t0, $t0, 11        # Desplazando 11 bits a la derecha para eliminar el index  
        andi $v1, $t0, 0x7FFF   # Cargando en v1 el tag 

        lw $ra, 0($sp)          # cargando de pila dato
        lw $t0, 4($sp)          # cargando de pila dato
        addi $sp, $sp, 8        # llenando espacio en la pila

        jr $ra                  # Volviendo al llamado


 
