    #   Funcion que inicializa la cache en 0 tanto su arreglo de conjuntos como su arreglo de tags

    inicializarCacheEnCero:
        addi $sp, $sp, -24      # Pidiendo espacio en la pila
        sw $ra, 0($sp)          # Guardando en pila dato a utilizar
        sw $t0, 4($sp)          # Guardando en pila dato a utilizar
        sw $t1, 8($sp)          # Guardando en pila dato a utilizar
        sw $s0, 12($sp)         # Guardando en pila dato a utilizar
        sw $s1, 16($sp)         # Guardando en pila dato a utilizar
        sw $s7, 20($sp)         # Guardando en pila dato a utilizar

        la $t0, Sets            # Cargando en $t0 la direccion del arreglo de sets
        li $s0, 0               # Contador i = 0
        li $s1, 8192            # final del contador
        li $s7, 10              # 10 para llenar la cache, indica que la misma esta vacia
        cicloSets:
            addu $t1, $t0, $s0       # t1 = a0 + i
            sb $s7, 0($t1)           # Guardando 10 en el arreglo de sets
            addi $s0, $s0, 1        # i = i+1
            bne $s0, $s1, cicloSets # Termina si el i = 8192


        la $t0, tags                # Cargando en $t1 la direccion del arreglo de tags
        li $s0, 0                   # Contador i = 0
        li $s1, 32767               # final del contador
        ciclotags:
            addu $t1, $t0, $s0       # t1 = a0 + i
            sb $0, 0($t1)           # Guardando NULL en el arreglo
            addi $s0, $s0, 1        # i = i+1
            bne $s0, $s1, ciclotags # Termina si el i = 32767            

        lw $ra, 0($sp)          # cargando de pila dato
        lw $t0, 4($sp)          # cargando de pila dato
        lw $t1, 8($sp)          # Guardando en pila dato a utilizar
        lw $s0, 12($sp)         # Guardando en pila dato a utilizar
        lw $s1, 16($sp)         # Guardando en pila dato a utilizar
        lw $s7, 20($sp)         # Guardando en pila dato a utilizar
        addi $sp, $sp, 24       # llenando espacio en la pila


        jr $ra                  # Volviendo al llamado

