    #Funcion que retorna 0 en v0 si la palabra ingresada fue un miss en politica de remplazo LRU
    # En a0 se pasa el index y en a1 el tag de la palabra
    # Retorna en v0 0 si fue miss, 1 si fue hit
     cacheMetodo:

        addi $sp, $sp, -44      # Pidiendo espacio en la pila
        sw $ra, 0($sp)          # Guardando en pila dato a utilizar
        sw $a0, 4($sp)          # Guardando en pila dato a utilizar
        sw $a1, 8($sp)          # Guardando en pila dato a utilizar
        sw $t0, 12($sp)         # Guardando en pila dato a utilizar
        sw $t1, 16($sp)         # Guardando en pila dato a utilizar
        sw $s7, 20($sp)         # Guardando en pila dato a utilizar
        sw $s1, 24($sp)         # Guardando en pila dato a utilizar
        sw $s4, 28($sp)         # Guardando en pila dato a utilizar
        sw $s2, 32($sp)         # Guardando en pila dato a utilizar
        sw $s3, 36($sp)         # Guardando en pila dato a utilizar
        sw $t3, 40($sp)         # Guardando en pila dato a utilizar

        move $a2, $a0           # Respaldo de index
        move $a3, $a1           # Respaldo de tag
        la $t0, tags            # Cargando en $t0 la direccion del arreglo de tags
        sll $t1, $a0, 4         # t1 = index*16
        addu $t1, $t1, $t0      # tags + index*16 = t1

        li $a1, 0               # i = 0
        li $s7, 4               # para saber cuando parar
        ciclo1cache:            #Ciclo que busca si existe un hit
            sll $s1, $a1, 2         # i*4
            addu $s4, $s1, $t1      # i*4 + index*16 + tags
            lbu $s2, 0($s4)         # cargando el bit de valido de la correspondiente via
            beq $0, $s2, ciclo1sumarcache #Continuando si el bit de valido es 0
            lw $s3, 0($s4)          #Palabra entera de la via i
            srl $s3, $s3, 16        #desplazando 16 bits a la derecha para tener el tag en #s3
            bne $s3, $a3, ciclo1sumarcache  #si el tag no es igual al tag del index, se sigue con el ciclo, en caso contrario...
            jal setLRUhit           #Guardando el hit
            sll $s3, $s3, 16        #corriendo 16 espacios a la izq
            ori $s3, $s3, 0x0001    #cargando 1 en bit de valido
            sw $s3, 0($s4)          #guardando la palabra de nuevo en el arreglo
            li $v0, 1               # fue hit
            j fincache              #Saliendo ya que ya se encontro el hit

        ciclo1sumarcache:
            addi $a1, $a1, 1    #i++
            beq $a1, $s7, finciclo1cache    # si ya se recorrieron todas las vias salta al final del ciclo
            j ciclo1cache   #repite el loop

        finciclo1cache:


        li $a1, 0               # i = 0
        li $s7, 4               # para saber cuando parar
        ciclo2cache:            #Ciclo que revisa si el bit de valido es 0 para ingresar el bloque en cache
            sll $s1, $a1, 2         # i*4
            addu $s4, $s1, $t1      # i*4 + index*16 + tags
            lbu $s2, 0($s4)         # cargando el bit de valido de la correspondiente via
            bne $0, $s2, ciclo2sumarcache   #Continuando si el bit de valido no es 0
            jal setLRUNOhit         # se ingresa ya que se encontro un bit valido 0
            move $t3, $a3           #cargando el tag en t3
            sll $t3, $t3, 16        #corriendo 16 espacios a la izq t3
            ori $t3, $t3, 0x0001    #cargando 1 en bit de valido en t3
            sw $t3, 0($s4)          #Guardando la palabra en la via i
            li $v0, 0               # fue miss
            j fincache              #Saliendo ya que ya se encontro el miss

        ciclo2sumarcache:
            addi $a1, $a1, 1    #i++
            beq $a1, $s7, finciclo2cache    # si ya se recorrieron todas las vias salta al final del ciclo
            j ciclo2cache   #repite el loop

        finciclo2cache:
        # Ingresando en cache el bloque como un miss, con politica LRU
        jal setLRUNOhit     #Devuelve en v0 la via donde se debe ingresar el tag que fue un miss
        sll $s1, $v0, 2         # i*4
        addu $s4, $s1, $t1      # via + index*16 + tags
        sll $a3, $a3, 16        #corriendo 16 espacios a la izq a3
        ori $a3, $a3, 0x0001    #cargando 1 en bit de valido en t3
        sw $a3, 0($s4)          # Guardando la palabra en el arreglo index
        li $v0, 0               # fue un miss              


        fincache:

            lw $ra, 0($sp)          # Cargando en pila dato a utilizar
            lw $a0, 4($sp)          # Cargando en pila dato a utilizar
            lw $a1, 8($sp)          # Cargando en pila dato a utilizar
            lw $t0, 12($sp)         # Cargando en pila dato a utilizar
            lw $t1, 16($sp)         # Cargando en pila dato a utilizar
            lw $s7, 20($sp)         # Cargando en pila dato a utilizar
            lw $s1, 24($sp)         # Cargando en pila dato a utilizar
            lw $s4, 28($sp)         # Cargando en pila dato a utilizar
            lw $s2, 32($sp)         # Cargando en pila dato a utilizar
            lw $s3, 36($sp)         # Cargando en pila dato a utilizar
            lw $t3, 40($sp)         # Cargando en pila dato a utilizar
            addi $sp, $sp, 44       # devolviendo espacio en la pila

            jr $ra                  # Volviendo al llamado

##########################################################################################################################    
