    # Funcion que retorna en v0 la cantidad de palabras leidas y en v1 la cantidad de hits
    leyendoPalabrasEnCache:
        addi $sp, $sp, -4      # Pidiendo espacio en la pila
        sw $ra, 0($sp)          # Guardando en pila dato a utilizar

    
        jal inicializarCacheEnCero  # Inicializando cache en 0

        la $s0, accesses            # accesses
        li $t0, 0                   # Contador i = 0
        li $t1, 0                   # Contador de hits

        ciclo1leyendoPalabrasEnCache:
            sll $s1, $t0, 2     #ix4
            addu $s2, $s1, $s0  #accesses + ix4
            lw $s3, 0($s2)      # s3 = accesses[i]

            beq $s3, $0, finciclo1leyendoPalabrasEnCache    # Si la palabra es null se termina
            move $a0, $s3       # moviendo la palabra a analizar a a0 para llamar la funcion getTagAndIndex

            jal getTagAndIndex  #Devuelve en v0 el index (11 bits) y en v1 el tag (15bits)

            move $a0, $v0       # moviendo el index a a0
            move $a1, $v1       # moviendo el tag a a1  

            jal cacheMetodo     # Se encarga de la logica de la cache, devuelve 0 en v0 si fue miss, y 1 si fue hit

            add $t1, $t1, $v0   # Agregando a t1 si fue un hit (contando hits)
            addi $t0, $t0, 1    # i++

            j ciclo1leyendoPalabrasEnCache  # volviendo al ciclo
        finciclo1leyendoPalabrasEnCache:
        move $v0, $t0       # cantidad de palabras leidas
        move $v1, $t1       # cantidad de hits



        lw $ra, 0($sp)          # cargando de pila dato
        addi $sp, $sp, 4       # llenando espacio en la pila        
        jr $ra  # terminando funcion 






