    #Funcion que trabaja la logica LRU del arreglo de sets cuando se encuentra un hit en tags
    # Recibe en a0 el index del conjunto al cual modificar
    # Recibe en a1 la via en la que se encontro el hit (0,1,2,3)
    # No regresa nada

    setLRUhit:

        addi $sp, $sp, -48      # Pidiendo espacio en la pila
        sw $ra, 0($sp)          # Guardando en pila dato a utilizar
        sw $s0, 4($sp)          # Guardando en pila dato a utilizar
        sw $s1, 8($sp)          # Guardando en pila dato a utilizar
        sw $s2, 12($sp)         # Guardando en pila dato a utilizar
        sw $t7, 16($sp)         # Guardando en pila dato a utilizar
        sw $t0, 20($sp)         # Guardando en pila dato a utilizar
        sw $t1, 24($sp)         # Guardando en pila dato a utilizar
        sw $t2, 28($sp)         # Guardando en pila dato a utilizar
        sw $t3, 32($sp)         # Guardando en pila dato a utilizar
        sw $t4, 36($sp)         # Guardando en pila dato a utilizar
        sw $a0, 40($sp)         # Guardando en pila dato a utilizar
        sw $a1, 44($sp)         # Guardando en pila dato a utilizar

        la $s0, Sets            # Cargando en $s0 la direccion del arreglo de sets
        sll $s1, $a0, 2         # s1 = index*4
        addu $s1, $s1, $s0      # sets + index*4 = s1
        addu $s2, $s1, $a1      # sets + index*4 + via = s2
        lbu $t7, 0($s2)         # Cargando en t7 el numero que habia en la via a poner en 0 posteriormente

        li $t0, 4               #final contador
        li $t1, 0               # i = 0
        ciclo1setLRUhit:        # Ciclo para verificar si la cache tiene espacios vacios
            addu $t2, $s1, $t1  # t2 = sets + index*4 + i
            lbu $t3, 0($t2)     # t3 = bit de via i
            slt $t4, $t3, $t7   # si bit de via i es menor que bit de via a cambiar, se le suma 1 al bit de via i
            bne $0, $t4, sumarsetLRUhit
            j iplusplussetLRUhit

            sumarsetLRUhit:
                addi $t3, $t3, 1    # Numero anterior de la via + 1
                sb $t3, 0($t2)      # guardando Numero anterior de la via + 1 
            iplusplussetLRUhit:
                addi $t1, $t1, 1    #i++
                beq $t1, $t0, finciclo1setLRUhit    # si ya leyo los 3 elementos se sale
                j ciclo1setLRUhit   #Vuelve al ciclo de arriba

        finciclo1setLRUhit:
            sb $0, 0($s2)         # guardando en la via que se dio el hit un 0


            lw $ra, 0($sp)          # Cargando en pila dato a utilizar
            lw $s0, 4($sp)          # Cargando en pila dato a utilizar
            lw $s1, 8($sp)          # Cargando en pila dato a utilizar
            lw $s2, 12($sp)         # Cargando en pila dato a utilizar
