            lw $t4, 36($sp)         # Cargando en pila dato a utilizar
            lw $a0, 40($sp)         # Cargando en pila dato a utilizar
            lw $a1, 44($sp)         # Cargando en pila dato a utilizar
            addi $sp, $sp, 48       # Devolviendo espacio en la pila
            jr $ra


