    # Funcion que se encarga de la logica LRU cuando no se dio un hit
    # Recibe en a0 el index del conjunto al cual modificar
    # Retorna en v0 el numero de via en el cual se introdujo el nuevo dato para asi ingresarlo en el registro de tag

    setLRUNOhit:

        addi $sp, $sp, -36      # Pidiendo espacio en la pila
        sw $ra, 0($sp)          # Guardando en pila dato a utilizar
        sw $s0, 4($sp)          # Guardando en pila dato a utilizar
        sw $s1, 8($sp)          # Guardando en pila dato a utilizar
        sw $t0, 12($sp)         # Guardando en pila dato a utilizar
        sw $t2, 16($sp)         # Guardando en pila dato a utilizar
        sw $t3, 20($sp)         # Guardando en pila dato a utilizar
        sw $t4, 24($sp)         # Guardando en pila dato a utilizar
        sw $a0, 28($sp)         # Guardando en pila dato a utilizar
        sw $a1, 32($sp)         # Guardando en pila dato a utilizar

        la $s0, Sets            # Cargando en $s0 la direccion del arreglo de sets
        sll $s1, $a0, 2         # s1 = index*4
        addu $s1, $s1, $s0      # sets + index*4 = s1


        li $t0, 4               #final contador
        li $a1, 0               # i = 0
        li $t2, 10              #cargando 10 para saber si la cache esta vacia
        ciclo1setLRUNOhit:      # En este ciclo se recorre la cache para ver si esta vacia en algun punto, y llenar con el dato si es asi
            addu $t3, $s1, $a1  # t3 = sets + index*4 + i
            lbu $t4, 0($t3)     # t4 = bit de via i
            beq $t4, $t2, finsetLRUNOhit    #Si alguno de la cache es 10, se agrega a esa via
            addi $a1, $a1, 1    # i++
            beq $a1, $t0, finciclo1setLRUNOhit  #Terminando si ya leyo las 4 lineas
            j ciclo1setLRUNOhit                 # Volviendo al ciclo
        finciclo1setLRUNOhit:

        li $t0, 4                   #final contador
        li $a1, 0                   # i = 0
        li $t2, 3                   #cargando 3 para saber la via de la cache a la que se debe ingresar el dato  
        ciclo2setLRUNOhit:
            addu $t3, $s1, $a1                  # t3 = sets + index*4 + i
            lbu $t4, 0($t3)                     # t4 = bit de via i
            beq $t4, $t2, finsetLRUNOhit        #Si alguno de la cache es 3, se agrega a esa via el dato
            addi $a1, $a1, 1                    # i++
            j ciclo2setLRUNOhit                 # Volviendo al ciclo

        finsetLRUNOhit:
            move $v0, $a1   #Numero de via a $v0 para retornarlo
            jal setLRUhit   #Guardando el dato en la via correspondiente y arreglando la logica LRU

            lw $ra, 0($sp)          # Cargando en pila dato a utilizar
            lw $s0, 4($sp)          # Cargando en pila dato a utilizar
            lw $s1, 8($sp)          # Cargando en pila dato a utilizar
            lw $t0, 12($sp)         # Cargando en pila dato a utilizar
            lw $t2, 16($sp)         # Cargando en pila dato a utilizar
            lw $t3, 20($sp)         # Cargando en pila dato a utilizar
            lw $t4, 24($sp)         # Cargando en pila dato a utilizar
            lw $a0, 28($sp)         # Cargando en pila dato a utilizar
            lw $a1, 32($sp)         # Cargando en pila dato a utilizar
            addi $sp, $sp, 36       # Pidiendo espacio en la pila
            jr $ra

